function App() {
  return (
    <div>
      <heaer>
        <MainHeader />
      </heaer>
      <main>
        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="/product">
          <Product />
        </Route>
        <Route path="/product-detail/:productId">
          <ProductDetail />
        </Route>
      </main>
    </div>
  );
}

